Erano anni che non facevo l’albero di Natale, ma quest’anno lo abbiamo fatto il 2 novembre solo perché non vedevo l’ora di addobbarlo con Emma. E ho anche già partecipato a due workshop sull’allestimento della tavola delle feste! L’ultimo è stato giovedì sera, al Pink Xmas Party di Veepee. Io che ho poco tempo per tutto, di solito mi concentro sulle cose che vanno fatte senza soffermarmi sui dettagli. Ma ho capito che soprattutto nei momenti frenetici, è proprio l’attenzione alle piccole cose a regalarmi un po’ di calma e soddisfazione. E quindi questo inverno sarà così, un po’ più decorato del solito :-)
